import React, { useEffect, useState } from 'react';
import Spinner from './Spinner';
import { ContactServices } from './ContactServices';

const HomePage = () => {
  const [query, setQuery] = useState({
    text: ""
  });

  const [state, setState] = useState({
    loading: true,
    users: [],
    filteredUsers: [],
    errorMessage: ''
  });

  useEffect(() => {
    const fetchUsers = async () => {
      try {
        setState(prevState => ({ ...prevState, loading: true }));
        const response = await ContactServices.getAllContacts();

        if (response.httpStatusCode === 302) {
          // Set the user data into state
          setState(prevState => ({
            ...prevState,
            loading: false,
            users: response.data,
            filteredUsers: response.data
          }));
        } else {
          setState(prevState => ({
            ...prevState,
            loading: false,
            errorMessage: response.message || 'Failed to fetch users'
          }));
          alert(response.message || 'Failed to fetch users');
        }
      } catch (error) {
        setState(prevState => ({
          ...prevState,
          loading: false,
          errorMessage: 'Data not found'
        }));
        alert('Data not found'); // Alerting user in case of error
      }
    };

    fetchUsers();
  }, []);

  // Search Users
  const searchUser = (event) => {
    const searchText = event.target.value;
    setQuery({ ...query, text: searchText });

    const filtered = state.users.filter(user => 
      user.name.toLowerCase().includes(searchText.toLowerCase())
    );
    setState(prevState => ({ ...prevState, filteredUsers: filtered }));
  };

  const { loading, filteredUsers } = state;

  return (
    <>
      <section className='contact-search'>
        <div className="container p-3">
          <div className="grid">
            <div className="row">
              <div className="col">
                <p className='h3'>WELCOME TO HOME PAGE</p>
              </div>
            </div>
          </div>
          <div className="row">
            <div className="col-md-6">
              <form className='row'>
                <div className="col">
                  <div className="mb-2">
                    <input 
                      type="text" 
                      name='text' 
                      onChange={searchUser} 
                      value={query.text} 
                      placeholder='Search name' 
                      className='form-control'  
                    />
                  </div>
                </div>
              </form>
            </div>
          </div>
        </div>
      </section>
      {
        loading ? <Spinner /> : (
          <section className='contact-list'>
            <div className="container">
              <div className="row">
                {
                  filteredUsers.length > 0 && filteredUsers.map(user => {
                    const { id, name, dateofbirth, email } = user;
                    return (
                      <div className="col-md-6 mb-4" key={id}>
                        <div className="card d-flex justify-content-around">
                          <div className="card-body">
                            <div className="row align-items-center">
                              <div className="col-md-7">
                                <ul className="list-group">
                                  <li className="list-group-item list-group-item-action">Name: {name}</li>
                                  <li className="list-group-item list-group-item-action">Date of Birth: {dateofbirth}</li>
                                  <li className="list-group-item list-group-item-action">Email: {email}</li>
                                </ul>
                              </div>
                            </div>
                          </div>
                        </div>
                      </div>
                    );
                  })
                }
                {
                  filteredUsers.length === 0 && <p>No users found.</p>
                }
              </div>
            </div>
          </section>
        )
      }
    </>
  );
};

export default HomePage;
